import * as firebase from "firebase/app";

const firebaseConfig = {
    apiKey: precess.env.REACT_APP_API_KEY,
    authDomain: precess.env.REACT_APP_AUTH_DOMAIN,
    projectId: precess.env.REACT_APP_PROJECT_ID,
    storageBucket: precess.env.REACT_APP_STORAGE_BUCKET,
    messagingSenderId: precess.env.REACT_APP_MESSAGIN_ID,
    appId: precess.env.REACT_APP_APP_ID
  };

export default firebase.initializeApp(firebaseConfig);
